  static List<HymnsContent> list =[
    HymnsContent(id: 2092, position: 1, content: "A Suku, sumuluisa  \nEtokekiso lilo; \nKolisa ovisila  \nLesumuluho liove. \nWilisa kolondombua  \nOhenda lombembua; \nVa tumalisa ciwa  \nKesanju liocili.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_118, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2093, position: 2, content: "A Cime cocisola,  \nTu eca kokuove etali \nVakuetu va soliwa  \nKohenda yove yiwa. \nVa vindikiya ciwa  \nKovina via viha; \nSeveta onjo yavo  \nKohanda yesunga.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_118, typeStanza: HymnsContentCode.VERSE),
