    HymnsContent(id: 2095, position: 4, content: "Kupange wavo wosi  \nVa ameko lonjolela; \nVa kunamele ocili  \nKovina via velapo. \nVa yelisila onjila  \nYomuenyo wakulo; \nTiamisa itima viavo  \nKomuenyo wiyako.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_118, typeStanza: HymnsContentCode.VERSE),

