    HymnsContent(id: 2097, position: 2, content: "Eci a kala palo posi \nYesu ka kaile lonjo ya'e; \nHaimo o sanjuka la vosi \nVa kuata kuata apata.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_119, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2098, position: 3, content: "Vakuetu tu va lombela \nOkuti o va sumuluisa. \nVa likuminye lesunga \nOku liohela pokati.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_119, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2099, position: 4, content: "Va likolele pokati, \nHa va yuvula onjaya \nLovina viosi vi tiula \nEpata liavo konyima.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_119, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2100, position: 5, content: "Va tunge epata liombembua \nLohenda kuenda esumbilo. \nVa muisa utima umuamue \nWoku tekela kesunga.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_119, typeStanza: HymnsContentCode.VERSE),
