    HymnsContent(id: 2102, position: 1, content: "Ya sumuluha onjo yosi yatiama \nKoku sumbila Yesu u wa piãla; \nNda ocisola caye ci sikilamo \nLacimue civi ci yi nyola vali.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_120, typeStanza: HymnsContentCode.VERSE),
