    HymnsContent(id: 2104, position: 3, content: "Ya sumuluha onjo nda olonjali \nVi eca ku Yesu otumãla tuavo. \nKuenda va litumbika vosi olumue \nKungombo una uwa wotumeme.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_120, typeStanza: HymnsContentCode.VERSE),
