    HymnsContent(id: 2107, position: 1, content: "Okuacisola ca piãla cokilu, \nTueya komangu yove, okuahenda; \nNdokuti valo va kala lombembua, \nLoku li kuata kumue locisola.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_121, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2108, position: 2, content: "Va muisa esanju li imula esumuo, \nVa muisa ombembua yi va lembeleke; \nVa iha elavoko ndaño kolohali, \nLomuenyo una wa pua olohele.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_121, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2109, position: 3, content: "Amuenyo wa pua atondelo osi, \nVa kaila onima kuenda ombindikiyo; \nKuenje keteke lina lia sulako, \nVa tuila ndongula vomuenyo wavo.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_121, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2110, position: 4, content: "Va ihavo utõi woku kala ciwa, \nNdaño va sanga ovitangi via lua; \nVa imbe ovaso kokuove, a Ñala, \nOve Unuãtisi yovimuenyo viavo.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_121, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2111, position: 1, content: "Muli utanya etali vitima, \nWavelapo wekumbi.\nVolonulo vietu onjolela. \nYa tuila ndocinyi.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_122, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2112, content: "Muli utanya, muli utanya; \nVovitima vietu mu yela. \nEci Ñala Yesu o tu tuila, \nMuli utanya vitima.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_122, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2113, position: 2, content: "Muli isungo etali vitima \nViesivayo lia Yesu. \nLeye o ka vi yevelela, \nVelombe lia’e kilu.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_122, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2114, position: 3, content: "Muli esanju etali vitima \nLoneleho yohenda; \nMua wilile etali ocisola \nLombembua ndopomba.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_122, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2115, position: 1, content: "Ndeci oloneleho vi upa, \nEteku lioposi. \nHaico omãla va sanga, \nEteku liokilu.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_123, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2116, position: 2, content: "A Yesu, Ungombo womãla, \nTua nena kokuove. \nOmãla Suku a tu iha, \nHu va sumuluisa.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_123, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2117, position: 3, content: "Ka ku li vali o tela, \nOku va teyuila, \nKayonjo a lua a va sanga \nTe ove Unjovoli.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_123, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2118, position: 4, content: "Omo wa kala omõla \nKuatisavo omãla. \nOco va mole kokuove \nOnima yomuenyo.", hymnsNumber: UmHymnsNumberSeeder.EPATA_LIETAVO_123, typeStanza: HymnsContentCode.VERSE),
